css:
@-moz-document regexp(".*mangadex.org.*") {
::-webkit-scrollbar {
	background: black;
	width: 4px!important;
}
::-webkit-scrollbar-thumb {
	background: #ff6740;
	cursor: pointer!important;
	border-radius: 3px;
}

.v-avatar .v-icon, .v-avatar .v-image, .v-avatar .v-responsive__content, .v-avatar img, .v-avatar svg,
body, img, .cover,
.v-application .primary,
.v-list .v-list-item--active,
.header__image,
.progress,
.v-text-field--outlined fieldset,
.mdi-circle-medium::before,
.v-text-field.v-text-field--solo .v-input__append-inner, .v-text-field.v-text-field--solo .v-input__prepend-inner,
.swiper-pagination-bullet-active,
.subtitle{
	filter: invert(1)!important;
}
::selection {
  color: black;
  background: grey;
}
}
